const theme = {
  colors: {
    background: '#120632',     // Dark Purple
    text: '#FFFFFF',           // White Text
    primary: '#FF5E5E',        // Coral (primary)
    secondary: '#5EBAFF',      // Dodger Blue (secondary)
    accent: '#5EFFA1',         // Mint Green (accent)
    highlight: '#FFD95E',      // Mustard (highlight)
  },
};



export default theme;
